import React, { useState } from 'react'
import { makeStyles, withTheme } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';


const useStyles = makeStyles((theme) => ({
    button: {
        display: 'block',
        marginTop: theme.spacing(2),
        color: 'white',
    },
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    select: {
        color: 'white',
    }
}));

const SelectBot = (props) => {
    //const { selectedBot, setSelectedBot } = props;
    const [selectedBot, setSelectedBot] = useState();
    const [open, setOpen] = useState(false);
    const classes = useStyles();

    const handleChange = (event) => {
        setSelectedBot(event.target.value);
    };

    const handleClose = () => {
        setOpen(false);
    };

    const handleOpen = () => {
        setOpen(true);
    };

    return (
        <div className="select-bot-container">
            <Button className={classes.button} onClick={handleOpen}>
                Select a bot
      </Button>
            <FormControl className={classes.formControl}>
                <div>
                    <InputLabel className={classes.formControl} id="demo-controlled-open-select-label">Select a bot</InputLabel>
                    <Select
                        labelId="demo-controlled-open-select-label"
                        id="demo-controlled-open-select"
                        open={open}
                        onClose={handleClose}
                        onOpen={handleOpen}
                        value={selectedBot}
                        onChange={handleChange}
                        className={classes.select}
                    >
                        <MenuItem value={0}>Ten</MenuItem>
                        <MenuItem value={1}>Twenty</MenuItem>
                        <MenuItem value={2}>Thirty</MenuItem>
                    </Select>
                </div>
            </FormControl>
        </div>
    )
}

export default SelectBot
